define('text!documentation/app.html', ['module'], function(module) { module.exports = "<template><require from=\"./app-menu.html\"></require><mdc-toolbar class=\"mdc-theme--dark\" fixed=\"true\" waterfall=\"true\"><mdc-toolbar-row><mdc-toolbar-section start=\"true\"><a class=\"mdc-toolbar__title-link\" href=\"#/\"><h1 class=\"mdc-toolbar__title mdc-toolbar__title--full\">${title}</h1><h1 class=\"mdc-toolbar__title mdc-toolbar__title--medium\">${titleMedium}</h1><h1 class=\"mdc-toolbar__title mdc-toolbar__title--mini\">${titleMini}</h1></a></mdc-toolbar-section><mdc-toolbar-section end=\"true\" fit=\"true\"><a mdc-button=\"accent:true;\" href=\"#/documentation\">Documentation</a><a mdc-button=\"mdc-button\" href=\"#/components\">Components</a><a mdc-button=\"mdc-button\" href=\"https://github.com/ullfis/aurelia-mdc-bridge\" data-analytics-category=\"external\" data-analytics-action=\"github\">Github</a></mdc-toolbar-section></mdc-toolbar-row></mdc-toolbar><div class=\"mdc-toolbar-fixed-adjust\"><div class=\"container-permanent\"><mdc-drawer-permanent spacer=\"false\"><app-menu></app-menu></mdc-drawer-permanent><main class=\"mdc-typography--body1\"><router-view></router-view></main></div></div></template>"; });
define('text!documentation/index.html', ['module'], function(module) { module.exports = "<template><section><legend class=\"mdc-typography--display1\">Getting started</legend><mdc-grid><mdc-grid-cell span=\"12\"><legend class=\"mdc-typography--headline\">Aurelia cli</legend><p>1. Create a new or use an existing project with aurelia-cli.</p><pre><code-prism language=\"batch\">au new material-test\n...\ncd material-test\n</code-prism></pre><p>2. Install aurelia-mdc-bridge:</p><pre><code-prism language=\"batch\">au install aurelia-mdc-bridge\n</code-prism></pre><p>3. Include Material Design icons and fonts in index.html:</p><pre><code-prism language=\"html\">&lt;html class=\"mdc-typography\"&gt;\n  &lt;head&gt;\n    &lt;link href=\"https://fonts.googleapis.com/icon?family=Material+Icons\" rel=\"stylesheet\"&gt;\n    &lt;link href=\"https://fonts.googleapis.com/css?family=Roboto+Mono\" rel=\"stylesheet\"&gt;\n    &lt;link href=\"https://fonts.googleapis.com/css?family=Roboto:300,400,500\" rel=\"stylesheet\"&gt;\n    ...</code-prism></pre><a href=\"#/documentation/offline\">(Check out this to use icons and fonts offline)</a><p>4. Register the plugin in your main.js in src folder:</p><pre><code-prism language=\"javascript\">export function configure(aurelia) {\n  ...\n    aurelia.use.plugin('aurelia-mdc-bridge')\n  ...\n}\n</code-prism></pre><p>5. Import the css in your app.html:</p><pre><code-prism language=\"html\">&lt;require from=\"material-components-web/material-components-web.css\"&gt;&lt;/require&gt;\n\n</code-prism></pre></mdc-grid-cell><mdc-grid-cell span=\"8\"><p>6. Use it:</p><pre><code-prism language=\"html\">&lt;mdc-textfield value.bind=\"value\"&gt;          \n  Username\n&lt;/mdc-textfield&gt;            \n&lt;button mdc-button=\"raised: true;\" mdc-ripple&gt;Submit&lt;/button&gt;\n</code-prism></pre></mdc-grid-cell><mdc-grid-cell span=\"4\"><mdc-textfield value.bind=\"username\">Username</mdc-textfield><br><button mdc-button=\"raised: true;\" mdc-ripple=\"mdc-ripple\">Submit</button></mdc-grid-cell><mdc-grid-cell span=\"12\"><p>7. Check out <a href=\"#/components\">components</a> to add more components to your project.</p></mdc-grid-cell></mdc-grid></section></template>"; });
